                },
                new MedicalItemPublication { Id = 4, MedicalItemId = 4, PublicationId = 2, Description = @"Visiting specialists performing procedures:  Where specialists visit smaller centres to perform procedures, fees for these particular procedures are exclusive of after-care. The referring practitioner will then be entitled to subsequent hospital visits for after-care. If the referring practitioner is not available, the specialist shall, on consultation with the patient, choose an appropriate locum tenens. Both the surgeon and the practitioner who handled the after-care, must in such instances quote Modifier 0006 with the particular items which they use", NormalizedDescription = @"VISITINGSPECIALISTSPERFORMINGPROCEDURES:WHERESPECIALISTSVISITSMALLERCENTRESTOPERFORMPROCEDURES,FEESFORTHESEPARTICULARPROCEDURESAREEXCLUSIVEOFAFTER-CARE.THEREFERRINGPRACTITIONERWILLTHENBEENTITLEDTOSUBSEQUENTHOSPITALVISITSFORAFTER-CARE.IFTHEREFERRINGPRACTITIONERISNOTAVAILABLE,THESPECIALISTSHALL,ONCONSULTATIONWITHTHEPATIENT,CHOOSEANAPPROPRIATELOCUMTENENS.BOTHTHESURGEONANDTHEPRACTITIONERWHOHANDLEDTHEAFTER-CARE,MUSTINSUCHINSTANCESQUOTEMODIFIER0006WITHTHEPARTICULARITEMSWHICHTHEYUSE" },
                new MedicalItemPublication { Id = 5, MedicalItemId = 5, PublicationId = 2, Description = @"a) Use of own monitoring equipment in the rooms:  Remuneration for the use of any type of own monitoring equipment in the rooms for procedures performed under intravenous sedation - 15,00 clinical procedure units irrespective of the number of items of equipment provided.\r\nb) Use of own equipment in hospital theatre or unattached theatre unit:  Remuneration for the use of any type of own equipment for procedures performed in a hospital theatre or unattached theatre unit when appropriate equipment is not provided by the hospital - 15,00 clinical procedure units irrespective of the number of items of equipment provided.", NormalizedDescription = @"
