                new MedicalItemPublication { Id = 6, MedicalItemId = 6, PublicationId = 2, Description = @"Specialist surgeon assistant: Where a procedure requires a registered specialist surgeon assistant, the fee is 33,33% (1/3) of the fee for the specialist surgeon", NormalizedDescription = @"SPECIALISTSURGEONASSISTANT:WHEREAPROCEDUREREQUIRESAREGISTEREDSPECIALISTSURGEONASSISTANT,THEFEEIS33,33%(1/3)OFTHEFEEFORTHESPECIALISTSURGEON" },
                new MedicalItemPublication { Id = 7, MedicalItemId = 7, PublicationId = 2, Description = @"Assistant: The fee for an assistant is 20% of the fee for the specialist surgeon, with a minimum of 36,00 clinical procedure units. The minimum fee payable may not be less than 36,00 clinical procedures units", NormalizedDescription = @"ASSISTANT:THEFEEFORANASSISTANTIS20%OFTHEFEEFORTHESPECIALISTSURGEON,WITHAMINIMUMOF36,00CLINICALPROCEDUREUNITS.THEMINIMUMFEEPAYABLEMAYNOTBELESSTHAN36,00CLINICALPROCEDURESUNITS" },
                new MedicalItemPublication { Id = 8, MedicalItemId = 8, PublicationId = 2, Description = @"Local anaesthetic: (a) A fee for a local anaesthetic administered by the operator may only be charged for (1) an operation or procedure having a value greater than 30,00 clinical procedure units (i.e. 31,00 or more clinical procedure units allocated to a single item) or (2) where more than one operation or procedure is done at the same time with a combined value greater than 50,00 clinical procedure units. (b) The fee shall be calculated according to the basic anaesthetic units for the specific operation. Anaesthetic time may not be charged for, but the minimum fee as per Modifier 0036: Anaesthetic administered by a general practitioner, shall be applicable in such a case. (c) Not applicable to radiological procedures (such as angiography and myelography. (d) No fee may be levied for topical application of local anaesthetic. (e) Please note: Modifier 0010: Local anaesthetic administered by the operator, may not be added on the surgeon?s account for procedures that were performed under general anaesthetic.", NormalizedDescription = @"LOCALANAESTHETIC:(A)AFEEFORALOCALANAESTHETICADMINISTEREDBYTHEOPERATORMAYONLYBECHARGEDFOR(1)ANOPERATIONORPROCEDUREHAVINGAVALUEGREATERTHAN30,00CLINICALPROCEDUREUNITS(I.E.31,00ORMORECLINICALPROCEDUREUNITSALLOCATEDTOASINGLEITEM)OR(2)WHEREMORETHANONEOPERATIONORPROCEDUREISDONEATTHESAMETIMEWITHACOMBINEDVALUEGREATERTHAN50,00CLINICALPROCEDUREUNITS.(B)THEFEESHALLBECALCULATEDACCORDINGTOTHEBASICANAESTHETICUNITSFORTHESPECIFICOPERATION.ANAESTHETICTIMEMAYNOTBECHARGEDFOR,BUTTHEMINIMUMFEEASPERMODIFIER0036:ANAESTHETICADMINISTEREDBYAGENERALPRACTITIONER,SHALLBEAPPLICABLEINSUCHACASE.(C)NOTAPPLICABLETORADIOLOGICALPROCEDURES(SUCHASANGIOGRAPHYANDMYELOGRAPHY.(D)NOFEEMAYBELEVIEDFORTOPICALAPPLICATIONOFLOCALANAESTHETIC.(E)PLEASENOTE:MODIFIER0010:LOCALANAESTHETICADMINISTEREDBYTHEOPERATOR,MAYNOTBEADDEDONTHESURGEON?SACCOUNTFORPROCEDURESTHATWEREPERFORMEDUNDERGENERALANAESTHETIC." },
                new MedicalItemPublication { Id = 9, MedicalItemId = 9, PublicationId = 2, Description = @"Emergency procedures: Any bona fide, justifiable emergency procedure (all hours) undertaken in an operating theatre and/or in another setting in lieu of an operating theatre, will attract an additional 12,00 clinical procedure units per half-hour or part thereof of the operating time for all members of the surgical team. Modifier 0011 does not apply in respect of patients on scheduled lists. (A medical emergency is any condition where death or irreparable harm to the patient will result if there are undue delays in receiving appropriate medical treatment)", NormalizedDescription = @"EMERGENCYPROCEDURES:ANYBONAFIDE,JUSTIFIABLEEMERGENCYPROCEDURE(ALLHOURS)UNDERTAKENINANOPERATINGTHEATREAND/ORINANOTHERSETTINGINLIEUOFANOPERATINGTHEATRE,WILLATTRACTANADDITIONAL12,00CLINICALPROCEDUREUNITSPERHALF-HOURORPARTTHEREOFOFTHEOPERATINGTIMEFORALLMEMBERSOFTHESURGICALTEAM.MODIFIER0011DOESNOTAPPLYINRESPECTOFPATIENTSONSCHEDULEDLISTS.(AMEDICALEMERGENCYISANYCONDITIONWHEREDEATHORIRREPARABLEHARMTOTHEPATIENTWILLRESULTIFTHEREAREUNDUEDELAYSINRECEIVINGAPPROPRIATEMEDICALTREATMENT)" },
                new MedicalItemPublication { Id = 10, MedicalItemId = 10, PublicationId = 2, Description = @"Endoscopic examinations done at operations: Where a related endoscopic examination is done at an operation by the operating surgeon or the attending anaesthesiologist, only 50% of the fee for the endoscopic examination may be charged", NormalizedDescription = @"ENDOSCOPICEXAMINATIONSDONEATOPERATIONS:WHEREARELATEDENDOSCOPICEXAMINATIONISDONEATANOPERATIONBYTHEOPERATINGSURGEONORTHEATTENDINGANAESTHESIOLOGIST,ONLY50%OFTHEFEEFORTHEENDOSCOPICEXAMINATIONMAYBECHARGED" },
                new MedicalItemPublication { Id = 11, MedicalItemId = 11, PublicationId = 2, Description = @"Operations previously performed by other surgeons: Where an operation is performed which has been previously performed by another surgeon, e.g. a revision or repeat operation, the fee shall be calculated according to the tariff for the full operation plus an additional fee to be negotiated under general Rule J: In exceptional cases where the fee is disproportionately low in relation to actual service rendered, except where already specified in the tariff", NormalizedDescription = @"OPERATIONSPREVIOUSLYPERFORMEDBYOTHERSURGEONS:WHEREANOPERATIONISPERFORMEDWHICHHASBEENPREVIOUSLYPERFORMEDBYANOTHERSURGEON,E.G.AREVISIONORREPEATOPERATION,THEFEESHALLBECALCULATEDACCORDINGTOTHETARIFFFORTHEFULLOPERATIONPLUSANADDITIONALFEETOBENEGOTIATEDUNDERGENERALRULEJ:INEXCEPTIONALCASESWHERETHEFEEISDISPROPORTIONATELYLOWINRELATIONTOACTUALSERVICERENDERED,EXCEPTWHEREALREADYSPECIFIEDINTHETARIFF" },
                new MedicalItemPublication { Id = 12, MedicalItemId = 12, PublicationId = 2, Description = @"Intravenous infusions: Where intravenous infusions (including blood and blood cellular products) are administered as part of the after-treatment after the operation or confinement, no extra fees shall be charged as this is included in the global operative or maternity fees.  Should the practitioner doing the operation or attending to the maternity case prefer to ask another practitioner to perform post-operative or post-confinement intravenous infusions, then the practitioner himself (and not the patient) shall be responsible for remunerating such practitioner for the infusions", NormalizedDescription = @"INTRAVENOUSINFUSIONS:WHEREINTRAVENOUSINFUSIONS(INCLUDINGBLOODANDBLOODCELLULARPRODUCTS)AREADMINISTEREDASPARTOFTHEAFTER-TREATMENTAFTERTHEOPERATIONORCONFINEMENT,NOEXTRAFEESSHALLBECHARGEDASTHISISINCLUDEDINTHEGLOBALOPERATIVEORMATERNITYFEES.SHOULDTHEPRACTITIONERDOINGTHEOPERATIONORATTENDINGTOTHEMATERNITYCASEPREFERTOASKANOTHERPRACTITIONERTOPERFORMPOST-OPERATIVEORPOST-CONFINEMENTINTRAVENOUSINFUSIONS,THENTHEPRACTITIONERHIMSELF(ANDNOTTHEPATIENT)SHALLBERESPONSIBLEFORREMUNERATINGSUCHPRACTITIONERFORTHEINFUSIONS" },
                new MedicalItemPublication { Id = 13, MedicalItemId = 13, PublicationId = 2, Description = @"Injections administered by practitioners: When desensitisation, intravenous, intramuscular or subcutaneous injections are administered by the practitioner him-/herself to patients who attend the consulting rooms, a first injection forms part of the consultation/visit and only all subsequent injections for the same condition should be charged at 7.50 consultative services units using modifier 0017 to reflect the amount (not chargeable together with a consultation item)", NormalizedDescription = @"INJECTIONSADMINISTEREDBYPRACTITIONERS:WHENDESENSITISATION,INTRAVENOUS,INTRAMUSCULARORSUBCUTANEOUSINJECTIONSAREADMINISTEREDBYTHEPRACTITIONERHIM-/HERSELFTOPATIENTSWHOATTENDTHECONSULTINGROOMS,AFIRSTINJECTIONFORMSPARTOFTHECONSULTATION/VISITANDONLYALLSUBSEQUENTINJECTIONSFORTHESAMECONDITIONSHOULDBECHARGEDAT7.50CONSULTATIVESERVICESUNITSUSINGMODIFIER0017TOREFLECTTHEAMOUNT(NOTCHARGEABLETOGETHERWITHACONSULTATIONITEM)" },
                new MedicalItemPublication { Id = 14, MedicalItemId = 14, PublicationId = 2, Description = @"Surgical modifier for persons with a BMI of 35> (calculated according to kg/m2): Fee for procedure +50% for surgeons and a 50% increase in anaesthetic time units for anaesthesiologists", NormalizedDescription = @"SURGICALMODIFIERFORPERSONSWITHABMIOF35>(CALCULATEDACCORDINGTOKG/M2):FEEFORPROCEDURE+50%FORSURGEONSANDA50%INCREASEINANAESTHETICTIMEUNITSFORANAESTHESIOLOGISTS" },
                new MedicalItemPublication { Id = 15, MedicalItemId = 15, PublicationId = 2, Description = @"Surgery on neonates (up to and including 28 days after birth) and low birth weight infants (less than 2500g) under general anaesthesia (excluding circumcision): per fee for procedure + 50% for surgeons and a 50% increase in anaesthetic time units for anaesthesiologists", NormalizedDescription = @"SURGERYONNEONATES(UPTOANDINCLUDING28DAYSAFTERBIRTH)ANDLOWBIRTHWEIGHTINFANTS(LESSTHAN2500G)UNDERGENERALANAESTHESIA(EXCLUDINGCIRCUMCISION):PERFEEFORPROCEDURE+50%FORSURGEONSANDA50%INCREASEINANAESTHETICTIMEUNITSFORANAESTHESIOLOGISTS" },
                new MedicalItemPublication { Id = 16, MedicalItemId = 16, PublicationId = 2, Description = @"Where in the treatment of a specific fracture or dislocation (compound or closed) an initial procedure is followed within one month by an open reduction, internal fixation, external skeletal fixation or bone grafting on the same bone, the fee for the initial treatment of that fracture or dislocation shall be reduced by 50%.   Please note:  This reduction does not include the assistant?s fee where applicable.  After one month, a full fee as for the initial treatment, is applicable", NormalizedDescription = @"WHEREINTHETREATMENTOFASPECIFICFRACTUREORDISLOCATION(COMPOUNDORCLOSED)ANINITIALPROCEDUREISFOLLOWEDWITHINONEMONTHBYANOPENREDUCTION,INTERNALFIXATION,EXTERNALSKELETALFIXATIONORBONEGRAFTINGONTHESAMEBONE,THEFEEFORTHEINITIALTREATMENTOFTHATFRACTUREORDISLOCATIONSHALLBEREDUCEDBY50%.PLEASENOTE:THISREDUCTIONDOESNOTINCLUDETHEASSISTANT?SFEEWHEREAPPLICABLE.AFTERONEMONTH,AFULLFEEASFORTHEINITIALTREATMENT,ISAPPLICABLE" },
                new MedicalItemPublication { Id = 17, MedicalItemId = 17, PublicationId = 2, Description = @"A fracture NOT requiring reduction shall be charged on a fee per service basis", NormalizedDescription = @"AFRACTURENOTREQUIRINGREDUCTIONSHALLBECHARGEDONAFEEPERSERVICEBASIS" },
                new MedicalItemPublication { Id = 18, MedicalItemId = 18, PublicationId = 2, Description = @"Where in the treatment of a fracture or dislocation, an initial closed reduction is followed within one month by further closed reductions under general anaesthesia, the fee for such subsequent reductions will be 27,00 clinical procedure units (not including after-care)", NormalizedDescription = @"WHEREINTHETREATMENTOFAFRACTUREORDISLOCATION,ANINITIALCLOSEDREDUCTIONISFOLLOWEDWITHINONEMONTHBYFURTHERCLOSEDREDUCTIONSUNDERGENERALANAESTHESIA,THEFEEFORSUCHSUBSEQUENTREDUCTIONSWILLBE27,00CLINICALPROCEDUREUNITS(NOTINCLUDINGAFTER-CARE)" },
                new MedicalItemPublication { Id = 19, MedicalItemId = 19, PublicationId = 2, Description = @"Except where otherwise specified, in cases of compound fractures, 77,00 clinical procedure units (specialists) and 77,00 clinical procedure units (general practitioners) are to be added to the units for the fractures including debridement", NormalizedDescription = @"EXCEPTWHEREOTHERWISESPECIFIED,INCASESOFCOMPOUNDFRACTURES,77,00CLINICALPROCEDUREUNITS(SPECIALISTS)AND77,00CLINICALPROCEDUREUNITS(GENERALPRACTITIONERS)ARETOBEADDEDTOTHEUNITSFORTHEFRACTURESINCLUDINGDEBRIDEMENT" },
                new MedicalItemPublication { Id = 20, MedicalItemId = 20, PublicationId = 2, Description = @"In cases of a compound fracture where a debridement is followed by internal fixation (excluding fixation with Kirschner wires, as well as  fractures of hands and feet), the full amount according to either Modifier 0049:  Cases of compound fractures, or Modifier 0051:  Fractures requiring open reduction, internal fixation, external skeletal fixation and/or bone grafting, may be added to the fee for the procedure involved, plus half of the amount according to the second modifier (either Modifier 0049: Cases of compound fractures or Modifier 0051: Fractures requiring open reduction, internal fixation, external skeletal fixation and/or bone grafting, as applicable) ", NormalizedDescription = @"INCASESOFACOMPOUNDFRACTUREWHEREADEBRIDEMENTISFOLLOWEDBYINTERNALFIXATION(EXCLUDINGFIXATIONWITHKIRSCHNERWIRES,ASWELLASFRACTURESOFHANDSANDFEET),THEFULLAMOUNTACCORDINGTOEITHERMODIFIER0049:CASESOFCOMPOUNDFRACTURES,ORMODIFIER0051:FRACTURESREQUIRINGOPENREDUCTION,INTERNALFIXATION,EXTERNALSKELETALFIXATIONAND/ORBONEGRAFTING,MAYBEADDEDTOTHEFEEFORTHEPROCEDUREINVOLVED,PLUSHALFOFTHEAMOUNTACCORDINGTOTHESECONDMODIFIER(EITHERMODIFIER0049:CASESOFCOMPOUNDFRACTURESORMODIFIER0051:FRACTURESREQUIRINGOPENREDUCTION,INTERNALFIXATION,EXTERNALSKELETALFIXATIONAND/ORBONEGRAFTING,ASAPPLICABLE)" },
                new MedicalItemPublication { Id = 21, MedicalItemId = 21, PublicationId = 2, Description = @"Fractures requiring open reduction, internal fixation, external skeletal fixation and/or bone grafting: Specialists add 77,00 clinical procedure units. General practitioners add 77,00 clinical procedure units", NormalizedDescription = @"FRACTURESREQUIRINGOPENREDUCTION,INTERNALFIXATION,EXTERNALSKELETALFIXATIONAND/ORBONEGRAFTING:SPECIALISTSADD77,00CLINICALPROCEDUREUNITS.GENERALPRACTITIONERSADD77,00CLINICALPROCEDUREUNITS" },
                new MedicalItemPublication { Id = 22, MedicalItemId = 22, PublicationId = 2, Description = @"Fracture requiring percutaneous internal fixation [insertion and removal of fixatives (wires) in respect of fingers and toes included]: Specialists and general practitioners add 32,00 clinical procedure units", NormalizedDescription = @"FRACTUREREQUIRINGPERCUTANEOUSINTERNALFIXATION[INSERTIONANDREMOVALOFFIXATIVES(WIRES)INRESPECTOFFINGERSANDTOESINCLUDED]:SPECIALISTSANDGENERALPRACTITIONERSADD32,00CLINICALPROCEDUREUNITS" },
                new MedicalItemPublication { Id = 23, MedicalItemId = 23, PublicationId = 2, Description = @"Dislocation requiring open reduction: Units for the specific joint plus 77,00 clinical procedure units for specialists. General practitioners add 77,00 clinical procedure units", NormalizedDescription = @"DISLOCATIONREQUIRINGOPENREDUCTION:UNITSFORTHESPECIFICJOINTPLUS77,00CLINICALPROCEDUREUNITSFORSPECIALISTS.GENERALPRACTITIONERSADD77,00CLINICALPROCEDUREUNITS" },
                new MedicalItemPublication { Id = 24, MedicalItemId = 24, PublicationId = 2, Description = @"Multiple procedures on feet: In multiple procedures on feet, fees for the first foot are calculated according to Modifier 0005: Multiple procedures/operations under the same anaesthetic. Calculate fees for the second foot in the same way, reduce the total to 75% and add to the total for the first foot", NormalizedDescription = @"MULTIPLEPROCEDURESONFEET:INMULTIPLEPROCEDURESONFEET,FEESFORTHEFIRSTFOOTARECALCULATEDACCORDINGTOMODIFIER0005:MULTIPLEPROCEDURES/OPERATIONSUNDERTHESAMEANAESTHETIC.CALCULATEFEESFORTHESECONDFOOTINTHESAMEWAY,REDUCETHETOTALTO75%ANDADDTOTHETOTALFORTHEFIRSTFOOT" },
                new MedicalItemPublication { Id = 25, MedicalItemId = 25, PublicationId = 2, Description = @"Revision operation for total joint replacement and immediate re-substitution (infected or non-infected): per fee for total joint replacement + 100%", NormalizedDescription = @"REVISIONOPERATIONFORTOTALJOINTREPLACEMENTANDIMMEDIATERE-SUBSTITUTION(INFECTEDORNON-INFECTED):PERFEEFORTOTALJOINTREPLACEMENT+100%" },
                new MedicalItemPublication { Id = 26, MedicalItemId = 26, PublicationId = 2, Description = @"Combined procedures on the spine: In cases of combined procedures on the spine, both the orthopaedic surgeon and the neurosurgeon are entitled to the full fee for the relevant part of the operation performed", NormalizedDescription = @"COMBINEDPROCEDURESONTHESPINE:INCASESOFCOMBINEDPROCEDURESONTHESPINE,BOTHTHEORTHOPAEDICSURGEONANDTHENEUROSURGEONAREENTITLEDTOTHEFULLFEEFORTHERELEVANTPARTOFTHEOPERATIONPERFORMED" },
                new MedicalItemPublication { Id = 27, MedicalItemId = 27, PublicationId = 2, Description = @"Where two specialists work together on a replantation procedure, each shall be entitled to two-thirds of the fee for the procedure", NormalizedDescription = @"WHERETWOSPECIALISTSWORKTOGETHERONAREPLANTATIONPROCEDURE,EACHSHALLBEENTITLEDTOTWO-THIRDSOFTHEFEEFORTHEPROCEDURE" },
                new MedicalItemPublication { Id = 28, MedicalItemId = 28, PublicationId = 2, Description = @"Where the replantation is unsuccessful, no further surgical fee is payable for amputation of the non-viable parts", NormalizedDescription = @"WHERETHEREPLANTATIONISUNSUCCESSFUL,NOFURTHERSURGICALFEEISPAYABLEFORAMPUTATIONOFTHENON-VIABLEPARTS" },
                new MedicalItemPublication { Id = 29, MedicalItemId = 29, PublicationId = 2, Description = @"Additional operative procedures by same surgeon, under section 3.8.6: Spinal deformities, within a period of 12 months: 75% of scheduled fee for the lesser procedure, except where otherwise specified elsewhere", NormalizedDescription = @"ADDITIONALOPERATIVEPROCEDURESBYSAMESURGEON,UNDERSECTION3.8.6:SPINALDEFORMITIES,WITHINAPERIODOF12MONTHS:75%OFSCHEDULEDFEEFORTHELESSERPROCEDURE,EXCEPTWHEREOTHERWISESPECIFIEDELSEWHERE" },
