                new MedicalItemPublication { Id = 31, MedicalItemId = 31, PublicationId = 2, Description = @"Microsurgery of the larynx: Add 25% to the fee of the operation performed (for other operations requiring the use of an operation microscope, the fee include the use of the microscope, except where otherwise specified elsewhere in the Tariff)", NormalizedDescription = @"MICROSURGERYOFTHELARYNX:ADD25%TOTHEFEEOFTHEOPERATIONPERFORMED(FOROTHEROPERATIONSREQUIRINGTHEUSEOFANOPERATIONMICROSCOPE,THEFEEINCLUDETHEUSEOFTHEMICROSCOPE,EXCEPTWHEREOTHERWISESPECIFIEDELSEWHEREINTHETARIFF)" },
